// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./EthRandom.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/security/Pausable.sol";

import "../dinosaur-token/Dinosaur.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

contract Salvation is EthRandom, Pausable, AccessControl {
    using SafeMath for uint256;

    struct FundShare { address member; uint256 share; }

    struct StageCard {
        uint256 startWith;
        uint256 escapeCards;
        uint256 normalCards;
        uint256 memberTotal;
        uint256 fee;
        uint256 currentEscape;
        uint256 currentNormal;
        uint256 nextStageDelay;
        uint256 expired;
    }

    string  constant public LASTEST_VERSION = "v1.0.1";
    bytes32 constant public ADMIN_ROLE = keccak256("ADMIN_ROLE");
    address constant public BLACK_HOLE_ADDRESS = 0x000000000000000000000000000000000000dEaD;
    address immutable public DINOSAUR_NFT_ADDRESS;
    address immutable public RESCUE_TOKEN_ADDRESS;

    FundShare[] private _funds;
    uint256 public CURRENT_STAGE = 0;

    mapping (address => bool) private _whiteList;
    mapping (address => bool) private _minted;
    mapping (uint256 => StageCard) private _stages;

    event RescueDinosaur(uint256 tokenId, uint256 stageRound, uint256 fee);

    constructor(
        address dinosaurNFT, address USDTAddress,
        address[] memory fundAddress, uint256[] memory fundShares,
        uint256[] memory totalCards, uint256[] memory escapeCards,
        uint256[] memory memberTotals
    ) {
        DINOSAUR_NFT_ADDRESS = dinosaurNFT;
        RESCUE_TOKEN_ADDRESS = USDTAddress;

        uint256 totalCount = 0;
        for (uint256 index = 0; index < fundAddress.length; index++) {
            _funds.push(FundShare(fundAddress[index], fundShares[index]));
        }

        for (uint256 index = 0; index < totalCards.length; index++) {
            _stages[index] = StageCard(
                0, escapeCards[index], totalCards[index] - escapeCards[index],
                memberTotals[index], index == 0 ? 0 : 5e16, 0, 0, 259200, 0
            );

            totalCount = totalCount + totalCards[index];
            if (index > 0) _stages[index].startWith = totalCount;
            else _stages[index].expired = block.timestamp;
        }

        _grantRole(ADMIN_ROLE, _msgSender());
    }

    function calculateTokenId(uint256 random) private returns (uint256) {
        StageCard storage stage = _stages[CURRENT_STAGE];
        uint256 escapeRange = stage.escapeCards.sub(stage.currentEscape);
        uint256 normalRange = stage.normalCards.sub(stage.currentNormal);
        uint256 randomResult = getRandomBySeed(random, escapeRange.add(normalRange));

        if (randomResult <= escapeRange) {
            stage.currentEscape = stage.currentEscape.add(1);
            return stage.currentEscape.add(stage.startWith);
        } else {
            stage.currentNormal = stage.currentNormal.add(1);
            return stage.currentNormal.add(stage.escapeCards);
        }
    }

    function isEscapeCard(uint256 stage, uint256 tokenId) public view returns (bool) {
        StageCard memory stageCard = _stages[stage];
        return tokenId >= stageCard.startWith && tokenId < stageCard.escapeCards;
    }

    function rescueForFree(uint256 escapeCard, uint256[] memory normalCards) private {
        StageCard memory stageCard = _stages[CURRENT_STAGE];
        require(isEscapeCard(CURRENT_STAGE, escapeCard), "INVALID_ESCAPE");
        require(normalCards.length == stageCard.memberTotal, "INVALID_MEMBER");

        Dinosaur dinosaurNFT = Dinosaur(DINOSAUR_NFT_ADDRESS);
        dinosaurNFT.transferFrom(_msgSender(), BLACK_HOLE_ADDRESS, escapeCard);
        for (uint256 i = 0; i < normalCards.length; i++)
            dinosaurNFT.transferFrom(_msgSender(), BLACK_HOLE_ADDRESS, normalCards[i]);

        uint256 tokenId = calculateTokenId(getRandomNumber());
        dinosaurNFT.mintTokenTo(_msgSender(), tokenId);

        emit RescueDinosaur(tokenId, CURRENT_STAGE, stageCard.fee);
    }

    function rescueForFee() private {
        StageCard memory stageCard = _stages[CURRENT_STAGE];
        require(msg.value >= stageCard.fee, "INVALID_RESCUE_FEE");
        bool expired = block.timestamp >= stageCard.expired.add(stageCard.nextStageDelay);
        require((CURRENT_STAGE != 0 && expired) || stageCard.expired == 0, "NOT_NOW");

        if (stageCard.fee > 0) {
            IERC20 rescueToken = IERC20(RESCUE_TOKEN_ADDRESS);
            for (uint256 index = 0; index < _funds.length; index++) {
                uint256 fee = stageCard.fee.mul(10000).div(_funds[index].share);
                rescueToken.transferFrom(_msgSender(), _funds[index].member, fee.div(10000));
            }
        }

        Dinosaur dinosaurNFT = Dinosaur(DINOSAUR_NFT_ADDRESS);
        uint256 tokenId = calculateTokenId(getRandomNumber());
        dinosaurNFT.mintTokenTo(_msgSender(), tokenId);
        if (CURRENT_STAGE == 0) _minted[_msgSender()] = true;

        emit RescueDinosaur(tokenId, CURRENT_STAGE, stageCard.fee);
    }

    function getStageDetail() external view returns (uint256[] memory stage) {
        stage = new uint256[](9);
        stage[0] = _stages[CURRENT_STAGE].startWith;
        stage[1] = _stages[CURRENT_STAGE].escapeCards;
        stage[2] = _stages[CURRENT_STAGE].normalCards;
        stage[3] = _stages[CURRENT_STAGE].memberTotal;
        stage[4] = _stages[CURRENT_STAGE].fee;
        stage[5] = _stages[CURRENT_STAGE].currentEscape;
        stage[6] = _stages[CURRENT_STAGE].currentNormal;
        stage[7] = _stages[CURRENT_STAGE].nextStageDelay;
        stage[8] = _stages[CURRENT_STAGE].expired;
    }

    function addWhiteList(address account) external onlyRole(ADMIN_ROLE) {
        _whiteList[account] = true;
    }

    function setStageDelay(uint256 stage, uint256 delay) external onlyRole(ADMIN_ROLE) {
        _stages[stage].nextStageDelay = delay;
    }

    function setStageRescueFee(uint256 stage, uint256 fee) external onlyRole(ADMIN_ROLE) {
        _stages[stage].fee = fee;
    }

    function rescueDinosaur(uint256 escapeCard, uint256[] memory normalCards)
        external whenNotPaused {

        require(_whiteList[_msgSender()] || CURRENT_STAGE != 0, "WHITE_LIST");
        // require(_minted[_msgSender()] == false || CURRENT_STAGE != 0, "ONLY_ONCE");
        require(CURRENT_STAGE == 0 || _stages[CURRENT_STAGE].expired == 0, "NOT_NOW");

        if (escapeCard <= 0) rescueForFee();
        else rescueForFree(escapeCard, normalCards);
    }
}
